import styled from 'styled-components'

export const Container = styled.div`
  margin: 0;
  padding: 0;
  box-sizing: border-box;
  font-family: 'Poppins', sans-serif;
`

export const Navigation = styled.div` 
.navigation {
    position: relative;
    width: 540px;
    height: 120px;
    box-shadow: 25px 25px 25px rgba(0,0,0,0.25),
    10px
}

`
